message.entry:
Each of the following Outport blocks has a signal object with non-auto storage class on its incoming signal line. In each case, insertion of an explicit signal buffer is required in simplified initialization mode to ensure correct initialization. However, a buffer cannot be inserted because, if inserted, Simulink will not be able to associate such non-auto storage class with the corresponding subsystem output. The buffer is needed for one or more of the following reasons:
    <br>(1) Outport is driven by a block with non-overwritable output such as a Ground, Constant, or a Stateflow block;
    <br>(2) Outport is connected to an input of a Merge block;
    <br>(3) Outport shares the same signal source with another Outport nested within the current subsystem but having an explicit initial output value of its own; or
    <br>(4) Outport shares the same signal source with another Outport in the same subsystem having an explicit initial output value of its own.

The following Relational Operator blocks have different slope adjustment factors for its first and second inputs. 
The first input has slope adjustment factor {0} 
The second input has slope adjustment factor {1} 
The net slope adjustment is {2} 
This mismatch causes the Relational Operator block to require a multiply operation each 
time the input with lesser positive range is converted to the data type and scaling of 
the input with greater positive range. 
To remove the mismatch, change the scaling of either of the inputs.

The following MinMax blocks have an input with a slope adjustment factor that does not 
equal the slope adjustment factor of the output. 
The input has slope adjustment factor {0} 
The output has slope adjustment factor {1} 
The net slope adjustment is {2} 
This mismatch causes the MinMax block to require a multiply operation each 
time the input is converted to the data type and scaling of the output. 
To remove this mismatch, change the scaling of either of the input or output.
